INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1000001, 1, -416.5, "カリン", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 3.414, "2030/01/01 14:59:59", 1, 2, 190805, "2025/01/31 12:00:00", 1, 62);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1000002, 1, -416.5, "カリン", "ミッションをクリアして、\n報酬をゲットしましょう！", 3.099, "2030/01/01 14:59:59", 2, 2, 190805, "2025/01/31 12:00:00", 1, 62);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1000003, 1, -416.5, "カリン", "受け取ることができる\n報酬があるようです\n確認してみてください", 2.801, "2030/01/01 14:59:59", 3, 2, 190805, "2025/01/31 12:00:00", 1, 63);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1000004, 2, -416.5, "カリン", "報酬がもらえますよ！\nチェックしてみてください", 0.0, "2030/01/01 14:59:59", 4, 2, 190805, "2025/01/31 12:00:00", 1, 63);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1000005, 2, -363.0, "カリン", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 2.12, "2030/01/01 14:59:59", 5, 1, 190805, "2025/01/31 12:00:00", 1, 64);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1000006, 1, -363.0, "カリン", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 1.68, "2030/01/01 14:59:59", 6, 2, 190805, "2025/01/31 12:00:00", 1, 64);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1000007, 2, -363.0, "カリン", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 2.33, "2030/01/01 14:59:59", 7, 1, 190805, "2025/01/31 12:00:00", 1, 64);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-6.0, 1020101, 3, -285.0, "ラビリスタ", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 5.18, "2030/01/01 14:59:59", 101, 7, 133701, "2025/01/31 12:00:00", 10201, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (-2.0, 1020102, 1, -285.0, "クリスティーナ", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 8.77, "2030/01/01 14:59:59", 201, 2, 133901, "2025/01/31 12:00:00", 10201, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020103, 6, -285.0, "ネネカ", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 15.5, "2030/01/01 14:59:59", 301, 1, 133801, "2025/01/31 12:00:00", 10201, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020201, 2, -285.0, "ランファ", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 9.061, "2030/01/01 14:59:59", 101, 5, 134301, "2025/02/28 12:00:00", 10202, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020202, 1, -285.0, "チカ", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 7.699, "2030/01/01 14:59:59", 201, 2, 134401, "2025/02/28 12:00:00", 10202, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020301, 1, -285.0, "アオイ", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 8.595, "2030/01/01 14:59:59", 101, 2, 134601, "2025/03/31 12:00:00", 10203, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020302, 1, -285.0, "クローチェ", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 7.758, "2030/01/01 14:59:59", 201, 2, 134501, "2025/03/31 12:00:00", 10203, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020401, 2, -285.0, "ルイズマリー", "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 7.0, "2030/01/01 14:59:59", 101, 6, 132302, "2025/04/30 12:00:00", 10204, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020402, 1, -285.0, "イロハ", "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 7.904, "2030/01/01 14:59:59", 201, 2, 132402, "2025/04/30 12:00:00", 10204, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020403, 4, -285.0, "ソノ", "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 8.487, "2030/01/01 14:59:59", 301, 2, 132502, "2025/04/30 12:00:00", 10204, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020502, 1, -285.0, "カノン", "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 8.763, "2030/01/01 14:59:59", 101, 2, 134901, "2025/05/31 12:00:00", 10205, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020503, 1, -285.0, "ツムギ", "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 6.417, "2030/01/01 14:59:59", 201, 3, 134801, "2025/05/31 12:00:00", 10205, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020601, 3, -285.0, "エリス", "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 10.335, "2030/01/01 14:59:59", 101, 7, 135001, "2025/06/30 12:00:00", 10206, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020602, 2, -285.0, "シェフィ", "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 6.281, "2030/01/01 14:59:59", 201, 4, 135101, "2025/06/30 12:00:00", 10206, 61);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (0.0, 1020603, 1, -285.0, "プレシア", "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 12.244, "2030/01/01 14:59:59", 301, 2, 135201, "2025/06/30 12:00:00", 10206, 61);
